import React from "react"
import styled from "@emotion/styled"
import NavItemList from "./NavItemList"
import Logo from "./Logo"

const toolbar = (props) => {
  let toolBarHeight = props.toolBarHeight
  let navItemList = props.toolBarItems.navItemList

  const Toolbar = styled.header`
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    background-color: #695340;
    height: ${toolBarHeight};
  `
  const ToolbarNavigation = styled.header`
    display: flex;
    align-items: center;
    height: 100%;
    padding: 0 1rem;
  `
  const Spacer = styled.header`
    flex: 1;
  `
  return (
    <Toolbar>
      <ToolbarNavigation>
        <div></div>
        <Logo />
        <Spacer></Spacer>
        <NavItemList navItemList={navItemList} />
      </ToolbarNavigation>
    </Toolbar>
  )
}

export default toolbar
